behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"showScorePoints\":true},\"correctAnswer\":\"صحيح!\",\"incorrectAnswer\":\"غير صحيح!\",\"missedAnswer\":\"افتقد!\",\"displaySolutionDescription\":\"يتم تحديث مهمة لاحتواء الحل.\",\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yFullTextLabel\":\"Full readable text\",\"a11yClickableTextLabel\":\"Full text where words can be marked\",\"a11ySolutionModeHeader\":\"Solution mode\",\"a11yCheckingHeader\":\"Checking mode\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"اعرض الحل. سيتم تمييز المهمة بالحل الصحيح الخاص بها.\",\"a11yRetry\":\"إعادة المحاولة للمهمة. إعادة ضبط جميع الردود والبدء بالمهمة مرة أخرى.\",\"taskDescription\":\"<p>                            </p>\\n\",\"textField\":\"<p style=\\\"text-align:right\\\">. هذا *الدّيكُ* ينقرُ الحبَّ ويصيحُ بصوتٍ عالٍ -</p>\\n\\n<p style=\\\"text-align:right\\\"> .هذا *الرّجلُ* يعملُ بجدٍّ واجتهادٍ -</p>\\n\\n<p style=\\\"text-align:right\\\">.قامِ *الطّبيبُ* بمعالجةِ *المريضِ* برفقٍ واهتمامٍ -</p>\\n\\n<p style=\\\"text-align:right\\\">.حرثَ *الفلّاحُ* الحقلَ في الصّباحِ الباكرِ -</p>\\n\\n<p style=\\\"text-align:right\\\"> </p>\\n\"},\"library\":\"H5P.MarkTheWords 1.11\",\"metadata\":{\"contentType\":\"Mark the Words\",\"license\":\"U\",\"title\":\"Mark the Words غير معنون\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Mark the Words غير معنون\"},\"subContentId\":\"33b23447-45bd-4028-9295-0c52e5f8d68a\"},\"useSeparator\":\"disabled\"},{\"content\":{\"params\":{\"text\":\"<p style=\\\"text-align:right\\\"><span style=\\\"font-size:1.375em\\\">  .٤- اضغطْ على الاسمِ المؤنّثِ الحقيقيّ الّذي ينتهي بتاءٍ مربوطةٍ</span></p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Text غير معنون\",\"authors\":[],\"changes\":[]},\"subContentId\":\"8dc2de31-c02c-4e7b-a2dc-cbe8336c59a1\"},\"use
